  \"2016-02-06T16:41:43.146515\",\n\t\"name\": \"users-guide-for-the-land-cover-map-of-the-coastal-plain-of-the-arctic-national-wildlife-re\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A landcover map of the coastal plain of
  the Arctic National Wildlife Refuge in northeastern Alaska was produced using LANOSA
  T Thematic Mapper satellite imagery, local topographical data, a map of terrain
  types, aerial photographs, and extensive field data from 198893. Methods and data
  used to produce the map, summary statistics, and an accuracy assessment are presented.
  Also presented are detailed quantitative descriptions of the landcover classes and
  a crossreference of this classification system to seven others used in northern
  Alaska. Sixteen landcover classes were mapped. They included: 1 Wet Graminoid Tundra,
  2 Wet Graminoid Tundra with 1050 moist inclusions, 3 Moist SedgeWillow Tundra with
  1050 wet inclusions, 4 Moist SedgeWillow Tundra, 5 Moist SedgeDryas Tundra, 6 Moist
  SedgeTussock Tundra, 7 Moist ShrubTussock Tundra, 8 Moist LowShrub Tundra, 9 Moist
  Shrub Tundra on highcentered polygons, 10 DryasGraminoid Alpine Tundra, 11 Riparian
  Shrub, 12 Dryas River Terrace, 13 Partially Vegetated, 14 Barren, 15 Ice, and 016
  Water. An accuracyassessment with an independent data set showed that pointbypoint
  agreement between the mapped landcover classes and the fieldassigned classes was
  50 for 16 classes. Agreement was increased to about 70 by combining similar classes
  into fewer, more general classes. The greater initial detail of the 16class map
  allows adaptability to a wider range of studies. The Users Guide was written for
  resource managers and researchers working in the Arctic National Wildlife Refuge.
  The guide should also be useful to others working with vegetation classification
  and mapping in arctic tundra ecosystems.\",\n\t\"license_title\": \"License Not
